export const InputField = styled.input`
  max-width: 100%;
  width: 758px;
  font-family: Roboto, sans-serif;
  font-size: 30px;
  font-weight: 300;
  text-transform: uppercase;
  border: 1px solid #a0a0a0;
  padding: 22px 25px 27px;
  margin-bottom: 30px;
